INSERT INTO SV_CAMPAIGN (CAMPAIGN_ID, CREATE_AT, LAST_MODIFY_AT, CAMPAIGN_ADDRESS, CAMPAIGN_CONTENT, CAMPAIGN_FINISH_AT, CAMPAIGN_IMG_URL, CAMPAIGN_START_AT, CAMPAIGN_TITLE, CAMPAIGN_STATUS, TARGET_TOKEN_AMOUNT, CAMPAIGN_FOUNDATION) VALUES(next value for hibernate_sequence, '2019-05-02 09:00:00.000', '2019-05-02 09:00:00.000', '0xec72bdc268daf3bb04cb984d2a6c7d37809c5075', "<h1>전국 미혼모 약 2만 2천명</h1><h4>(2017년, 통계청)</h4><h4 class=&quot;pd&quot;>미취학 자녀를 양육 중인 10~40대 미혼모 총 359명의 설문 조사에 따르면<br>조사 대상의 월 평균 소득액은 92만 3천원으로 자녀 양육과 생활비로는 물가 대비 턱없이 부족한 금액이며,<br>특히 10명 중 6명은 근로 소득이 없어 재정적 지원이 절실한 상황입니다.</h4><div class=&quot;backimg&quot;><img src=&quot;../img/give/story/2019-06-11_1.png&quot;><div class=&quot;subtxt&quot;>'아이에게 늘 미안할 따름이죠 <br>좋은 환경도 자상한 아빠도 없는데 <br>능력 또한 없는 엄마라서 <br> 너무 미안해요'</div></div><div class=&quot;sefif pd&quot;>꽃다운 나이라는 25살 아리씨 이야기</div><img src=&quot;../img/give/story/2019-06-11_2.png&quot;><h4>예상치 못한 임신으로 대학을 그만 둬야 했던 아리씨.<br>배가 제법 눈에 보일 만큼 불러올 때까지도 매일 10시간씩 식당 서빙 알바를 해야 했습니다.<br>출산을 반대하시는 부모님의 지원 없이 홀로 아이를 낳고 길러야 했기 때문입니다. </h4><div class=&quot;img2pic&quot;><ul><li><img src=&quot;../img/give/story/2019-06-11_3.png&quot;></li><li><img src=&quot;../img/give/story/2019-06-11_4.png&quot;></li></ul></div><h4>올해부터는 아이가 유치원에 다닐 수 있게 되어 아리씨는 사이버 대학에 입학했습니다.<br>낮에는 카페 알바를, 밤에는 아이를 재우고 강의를 듣습니다.<br>아리씨의 소망은 오직 하나,</h4><div class=&quot;sefif pd&quot;>&quot; 아이에게 떳떳한 엄마가 되는 것입니다. &quot;</div><img src=&quot;../img/give/story/2019-06-11_5.png&quot;><h4>싱글 맘이라는 이유만으로 사랑하는 아이에게 미안해하지 않을 수 있도록<br>아이를 위해 최선을 다하는 싱글 맘들의<br></h4><div class=&quot;sefif pd&quot;>든든한 후원자가 되어 주세요.</div><h4>여러분이 보내주시는 후원금은 싱글 맘들을 위해 다음과 같이 사용됩니다.</h4><div class=&quot;usinglist centerline&quot;><ul><li><p>육아비 및 생계비 지원</p></li><li><p>싱글 맘의 직업 훈련 교육</p></li></ul></div>"                                                                                                                                                                                                                                                                               , '2019-06-20 09:00:00.000', '/img/give/story/1/main.png', '2019-05-20 09:00:00.000', '혼자 엄마, 당당한 엄마'              , 'SUCCESS', 10000000, 'Foundation01');
INSERT INTO SV_CAMPAIGN (CAMPAIGN_ID, CREATE_AT, LAST_MODIFY_AT, CAMPAIGN_ADDRESS, CAMPAIGN_CONTENT, CAMPAIGN_FINISH_AT, CAMPAIGN_IMG_URL, CAMPAIGN_START_AT, CAMPAIGN_TITLE, CAMPAIGN_STATUS, TARGET_TOKEN_AMOUNT, CAMPAIGN_FOUNDATION) VALUES(next value for hibernate_sequence, '2019-05-02 09:00:00.000', '2019-05-02 09:00:00.000', '0xec72bdc268daf3bb04cb984d2a6c7d37809c5075', "<h1>공기청정기? NO! 도시숲? OK!</h1><h4 class=&quot;pd&quot;>작년 우리는 기상관측 113년만의 최악의 폭염을 맛보았습니다.<br/>다들 기억하시지요? 전기세에 대한 부담과 걱정도 너무나 컸던 여름이었습니다.<br/>우리는 그 무더위에 속수무책으로 당해야만 할까요? 방법이 있습니다.<br/>바로 기후조절에 큰 효과가 있는 나무를 도시 곳곳에 심어 숲을 조성하는 것입니다.<br/>도시숲은 여름 한 낮의 평균기온을 약 4도 낮춰주는 효과가 있습니다.<br/>만약 도시에 숲이 지속적으로 늘어난다면 우리는 조금 더 시원한 여름을 지낼 수 있습니다.</h4><img src=&quot;/img/give/story/2/detail1.png&quot;><div class=&quot;sefif pd&quot;>여름에는 시원한 도시숲으로 오세요!</div><h4>미세먼지로 인한 여러 가지 질병을 예방하기 위해 우리 주변의 가정들은 평균 1대씩은 공기 청정기를 구매합니다.<br/>하지만 공기 청정기가 확실한 대안일까요? 우리는 집에서 생활을 하지만 야외 활동에 대한 비율도 상당히 큽니다.<br/>그때마다 집에 있는 공기 청정기가 우리의 건강을 지켜줄까요?<br/>여러분, 천연 공기청정기 나무를 심으셔야 합니다! 도시숲의 미세먼지 저감 효과는 도심보다 기온이 낮고 습도가 높아 미세먼지 농도를 낮추는데 효과적입니다.<br/>미세하고 복잡한 표면을 가진 나뭇잎은 미세먼지를 흡착, 흡수하고 가지와 나무줄기가 침강하는 미세먼지를 차단합니다.<br/>나무 1그루가 연간 35.7g의 미세먼지를 흡수하는 것으로 나타나 도시숲 확대가 미세먼지 감소를 위한 핵심 대안으로 떠오르고 있습니다.<br/>나무 47그루의 미세먼지 흡수량은 경유차 1대의 연간 미세먼지 배출량과 동일한 1,680g입니다.<br/>미세먼지는 평균 25.6%, 초미세먼지는 평균 40.9%를 저감하는 효과를 가지고 있습니다.</h4><img src=&quot;/img/give/story/2/detail2.png&quot;><div class=&quot;sefif pd&quot;>시민과 함께 만들고 싶습니다.</div><h4>2019년부터는 미세먼지 없이 맑고 파란하늘을 보고 싶습니다.<br/>또, 여름에는 시원한 그늘에서 솔솔 불어오는 바람을 느끼고 싶습니다.<br/>다양한 생물들이 서식하는 푸른 도시를 만들고 싶습니다.<br/>'나무에게사랑을'에서는 시민들과 함께 숲을 만들고 지켜나가고 싶습니다.<br/>이 바램들이 단순히 '나무에게사랑을'만의 바람일까요? 저희는 여러분과 함께 만들고 싶습니다.<br/>지금도 저희는 우리의 푸른 도시를 위해 달리고 있습니다.<br/>저희의 손을 꼭 잡아주세요.<br/>많은 참여 부탁드립니다.</h4>", '2019-07-30 23:59:59.000', '/img/give/story/2/main.png', '2019-05-01 00:00:00.000', '같이가치 나무'                       , 'ING',     10000000, 'Foundation02');
INSERT INTO SV_CAMPAIGN (CAMPAIGN_ID, CREATE_AT, LAST_MODIFY_AT, CAMPAIGN_ADDRESS, CAMPAIGN_CONTENT, CAMPAIGN_FINISH_AT, CAMPAIGN_IMG_URL, CAMPAIGN_START_AT, CAMPAIGN_TITLE, CAMPAIGN_STATUS, TARGET_TOKEN_AMOUNT, CAMPAIGN_FOUNDATION) VALUES(next value for hibernate_sequence, '2019-05-02 09:00:00.000', '2019-05-02 09:00:00.000', '0xec72bdc268daf3bb04cb984d2a6c7d37809c5075', "<h1>시각장애인들의 호기심을 채워 주지 못하는 빈 벽</h1><h4 class=&quot;pd&quot;>아기였을 때 발생한 뇌종양으로 시각장애인이 된 영준(가명)이는 큰 눈에 맑은 눈동자를 가진 귀여운 얼굴이지만 앞을 전혀 볼 수 없는 전맹 시각장애인입니다.<br/>외부로 나들이를 나갈 때 마다 영준이의 끝없는 질문 때문에 함께 동행하는 사람은 머릿속은 하얗게 되고, 입은 바빠집니다.<br/>쉴 새 없이 설명을 이어가야하기 때문이죠.<br/>“이건 뭐예요?”, “이것은 뭐하는 물건이예요?”영준이는 요즘 새로운 질문들이 늘었습니다.<br/>“서울은 얼마나 커요?”, “OO지하철 역은 어디쯤 있는거예요?”, “에펠탑은 무슨 모양이예요?”<br/>설명만으로 이해하기 힘든 질문들.<br/>이제 우리는 빈 벽에 영준이 질문에 대한 답을 전달고자 합니다.</h4><img src=&quot;/img/give/story/3/detail1.png&quot;><div class=&quot;sefif pd&quot;>영준이의 호기심을 채워줄 입체 벽화 만들기</div><h4>시각장애인들이 함께 살고 있는 맑은빛맹아원 자립관이 영준이의 집 입니다.<br/>오래된 건물을 리모델링해서 시각장애인들이 살기는 편해졌지만 복도의 빈 벽은 단조롭고 썰렁하기만 합니다.<br/>한강을 중심으로 한 서울의 여러 자치구의 위치, 대한민국 전도가 있는 지도테마벽면.<br/>말로 하는 설명만으로 상상할 수 없는 세계의 유명 건축물들을 손으로 만질 수 있는 세계문화유산테마벽면.<br/>이 벽면을 우리 함께 멋진 입체벽화로 만들면 어떨까요?</h4><img src=&quot;/img/give/story/3/detail2.png&quot;><div class=&quot;sefif pd&quot;>함께 만들고 싶습니다.</div><h4>멋진 벽면이 완성되면 이웃을 초대해 시각장애인과 소통하는 공간으로 새롭게 탈바꿈 하고 싶습니다.<br/>그리고 호기심이 많은 우리 영준이에게도 멋진 답을 줄 수 있겠죠?<br/>아름다운 입체벽면, 함께 만들어 주세요.</h4>"                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           , '2019-07-30 23:59:59.000', '/img/give/story/3/main.png', '2019-06-01 00:00:00.000', '손끝으로 볼 수 있는 아름다운 갤러리' , 'ING',      6000000, 'Foundation03');
INSERT INTO SV_CAMPAIGN (CAMPAIGN_ID, CREATE_AT, LAST_MODIFY_AT, CAMPAIGN_ADDRESS, CAMPAIGN_CONTENT, CAMPAIGN_FINISH_AT, CAMPAIGN_IMG_URL, CAMPAIGN_START_AT, CAMPAIGN_TITLE, CAMPAIGN_STATUS, TARGET_TOKEN_AMOUNT, CAMPAIGN_FOUNDATION) VALUES(next value for hibernate_sequence, '2019-05-02 09:00:00.000', '2019-05-02 09:00:00.000', '0xec72bdc268daf3bb04cb984d2a6c7d37809c5075', "<h1>깨끗한 물로 아이들을 지켜주세요!</h1><h4>전쟁의 후유증으로 신음하는 라이베리아</h4><h4 class=&quot;pd&quot;>아프리카의 첫 번째 독립국(1847년) 라이베리아는 미국 노예매매제도가 금지된 후 해방된 노예들이 나라를 세워 “라이베리아=리버티(Liberty)” 자유의 뜻을 품고 있는 나라입니다.<br/>하지만 1980년부터 2005년까지 25년 동안 끊임없는 내전의 악순환이 이어졌고, 이로 인해 학교교육과 의료기반, 전력시설이나 정수시설 등 사회기반 시설이 완전히 파괴되어 현재까지도 모두 복구되지 못한 실정입니다.<br/>UN에 의하면 전쟁 후유증이 향후 50년 이상 계속될 것이라고 합니다.</h4><img src=&quot;/img/give/story/4/detail1.png&quot;><h4>세계적으로 매일 1,000명의 아동(5세미만)들이 오염된 물로 인한 질병으로 사망하고 있습니다.<br/>라이베리아는 전 인구의 75% 이상이 깨끗한 물을 공급받지 못하고 있습니다.<br/>뉴호프아카데미를 비롯한 라이베리아의 많은 학교는 학교 내 급수시설이 없어 학생들이 손을 씻지 못하거나 화장실 처리를 하지 못하는 등 위생상태가 열악한 상황입니다.<br/>오염된 물과 열악한 위생상태는 아이들에게 각종 수인성 질병을 일으켜서 학업에 악영향을 미치기도 합니다.</h4><img src=&quot;/img/give/story/4/detail2.png&quot;><div class=&quot;sefif pd&quot;>응원해주세요</div><h4>오염된 물로 인한 질병을 예방하기 위해 하루속히 피스아일랜드 지역 뉴호프아카데미 학교 내 깨끗한 물을 확보할 수 있는 물탱크 시설을 설치하고자 합니다.<br/>지금 이 아이들에게 가장 필요한 것은 깨끗한 물입니다.<br/>깨끗한 물과 청결한 위생시설을 통해 아이들이 건강하게 학업을 이어나갈 수 있도록 함께 응원해주세요.</h4>"                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             , '2019-12-30 23:59:59.000', '/img/give/story/4/main.png', '2019-06-01 00:00:00.000', '생명의 물 선물해요'                  , 'ING',      7000000, 'Foundation04');
INSERT INTO SV_CAMPAIGN (CAMPAIGN_ID, CREATE_AT, LAST_MODIFY_AT, CAMPAIGN_ADDRESS, CAMPAIGN_CONTENT, CAMPAIGN_FINISH_AT, CAMPAIGN_IMG_URL, CAMPAIGN_START_AT, CAMPAIGN_TITLE, CAMPAIGN_STATUS, TARGET_TOKEN_AMOUNT, CAMPAIGN_FOUNDATION) VALUES(next value for hibernate_sequence, '2019-05-02 09:00:00.000', '2019-05-02 09:00:00.000', '0xec72bdc268daf3bb04cb984d2a6c7d37809c5075', "<h1>아이들의 생명을 살리는 학교폭력상담전화</h1><h4>오늘도 쉴 새 없이 전화벨이 울립니다</h4><h4 class=&quot;pd&quot;>저희 기관 한 편에는 작은 상담실이 있습니다.<br/>책상 4개가 겨우 들어가는 이 협소한 공간에서 전화벨이 쉴 새 없이 울립니다.<br/>학교폭력 때문에 전국 각지에서 걸려온 전화들입니다.<br/>친구와의 다툼에 대한 고민부터 교실에서 일어난 학교폭력 분쟁에 대해 조언을 듣고자 하는 선생님, 자녀의 학교폭력 피해 사실이 의심되어 걱정된 마음으로 전화한 부모님 등 많은 사람들이 학교폭력에 대해 도움을 얻고자 전화를 합니다.<br/>많은 전화들이 저마다의 안타까운 사연을 갖고 있지만 그중에서 상담원들이 가장 걱정하는 전화들이 있습니다.</h4><img src=&quot;/img/give/story/5/detail1.png&quot;><div class=&quot;sefif pd&quot;>수화기에 처음 뱉은 말, &quot;저 좀 도와주세요!&quot;</div><h4>&quot;저 좀 도와주세요. 학교 가는 게 너무 무서워요!&quot;<br/>어디에도 말하지 못하고 혼자 품어왔던 마음이 눈물과 함께 쏟아집니다.<br/>‘이야기해도 소용없을 것 같아서’, ‘괴롭힘이 더 심해질까 봐’ 등 학교폭력 피해를 당하고도 도움을 요청하는 아이의 비율은 학년이 높아질수록 급격히 떨어집니다.<br/>그렇기에 두려움 속에서도 용기 내 수화기를 든 아이가 상담원들은 대견하고 고맙습니다</h4><img src=&quot;/img/give/story/5/detail2.png&quot;><div class=&quot;sefif pd&quot;>상처를 극복 할수 있게 함께 해주세요</div><h4>여러분의 소중한 후원금은 학교폭력 전문상담원들의 더 나은 활동 환경 마련과 위기에 처한 아이들을 위한 지원활동에 사용될 계획입니다.<br/>전화상담실의 노후 장비를 교체하여 통화품질과 상담 관리를 개선하고, 1시간이고 2시간이고 진심으로 아이들의 이야기에 귀 기울이는 학교폭력 전화 전문상담원들의 오래된 의자와 책상을 교체하여 상담원들이 아이들과의 상담에 더 전념할 수 있도록 돕고자 합니다.<br/>약 1,800건(6개월간 평균 상담 건수)의 전화상담 사례 중 전화상담만으로는 해결할 수 없는 5명의 저소득 가정 청소년들의 깊은 상처를 치료하기 위해 심층 대면 상담과 의료비·생활 지원을 통해 상처를 극복할 수 있게 함께해주세요.</h4>"                                                                                                                                                                                                                      , '2019-08-30 23:59:59.000', '/img/give/story/5/main.png', '2019-05-01 00:00:00.000', '외면 No! 손 내밀어주세요'            , 'ING',      8000000, 'Foundation05');
